import "@openzeppelin/contracts@4.4.2/access/Ownable.sol";

pragma solidity 0.8.1;

contract PrivilegedListStorage {

    struct Coupon {
        uint discountRate;
        uint numberOfUses;
    }

    struct CouponList { // each address in addressidToAddress has one couponidToAddress
        uint length;
        mapping(uint => Coupon) idToCoupon;
    }

    struct AddressList {
        uint length;
        mapping(uint => address) idToAddress; // <idToAddress> is enumerable, 1-indexed
        mapping(address => uint) addressToId; 
        mapping(uint => CouponList) couponList;
        // <addressToId> tracks the same info as <idToAddress>, but is inverted (allows address to be used as a key)
    }
    AddressList public addresses;

    function addAddress(address address_) internal {
        addresses.idToAddress[addresses.length+1] = address_; //<addresses.idToAddress> is 1-indexed not 0-indexed
        addresses.addressToId[address_] = addresses.length+1;
        addresses.length++;
    }

    /*
    *  @dev Removes <address_> from <addresses> and moves the last address in
    *       <addresses.idToAddress> into its spot. 
    *       Updates <addresses.addressToId> accordingly.  
    */
    function removeAddress(address address_) internal {
        
        uint _toRemove1 = addresses.addressToId[address_];
        address _toRemove2 = address_;

        uint _toMove1 = addresses.length;
        address _toMove2 = addresses.idToAddress[addresses.length];

        addresses.idToAddress[_toRemove1] = addresses.idToAddress[_toMove1];
        delete addresses.idToAddress[_toMove1];

        addresses.addressToId[_toRemove2] = addresses.addressToId[_toMove2];
        delete addresses.addressToId[_toMove2];
        
        addresses.length--;
    }

    function _initidToAddress() internal {
        addresses.length = 0;
        addAddress(0xc0ffee254729296a45a3885639AC7E10F9d54979);
        addAddress(0x59eeD72447F2B0418b0fe44C0FCdf15AAFfa1f77);
        addAddress(0xCb172d8fA7b46b53A6b0BDACbC5521b315D1d3F7);
